class EyeCatalog {

    private static _instance: EyeCatalog;

    public static get instance() {
        if (EyeCatalog._instance == null) {
            EyeCatalog._instance = new EyeCatalog();
        }
        return EyeCatalog._instance;
    }

    getEyes(token: Token) {
        let result = this.getEyeAndNoseEdge(token.eyeType, token.species, token.skinColor);
        return result.replace(/#754324/g, token.eyeColor)
            .replace(SpeciesRestrictions.DEFAULT_HAIR_COLOR_REGEX, token.hairColor);
    }

    private getEyeAndNoseEdge(eyeType: EyeType, species: Species, skinColor: string) {
        if (SpeciesRestrictions.isRubberHeaded(species)) {
            return "";
        } else if (species === Species.Tellarite) {
            switch (eyeType) {
                case EyeType.Eye1:
                    return Tellarite.eye1;
                case EyeType.Eye2:
                default:
                    return Tellarite.eye2;
            }
        } else {
            let result = Eye1;
            if (eyeType === EyeType.Eye2) {
                result = Eye2;
            } else if (eyeType === EyeType.Eye3) {
                result = Eye3;
            } else if (eyeType === EyeType.Eye4) {
                result = Eye4;
            } else if (eyeType === EyeType.Eye5) {
                result = Eye5;
            } else if (eyeType === EyeType.Eye6) {
                result = Eye6;
            } else if (eyeType === EyeType.Eye7) {
                result = Eye7;
            } else if (eyeType === EyeType.Eye8) {
                result = Eye8;
            } else if (eyeType === EyeType.Eye9) {
                result = Eye9;
            } else if (eyeType === EyeType.Eye10) {
                result = Eye10;
            } else if (eyeType === EyeType.Eye11) {
                result = Eye11;
            } else if (eyeType === EyeType.Eye12) {
                result = Eye12;
            }

            let noseEdge = "";
            if (species !== Species.Denobulan) {
                switch (eyeType) {
                    case EyeType.Eye1:
                    case EyeType.Eye2:
                        noseEdge = StandardNoseEdge;
                        break;

                    case EyeType.Eye8:
                    case EyeType.Eye9:
                    case EyeType.Eye10:
                    case EyeType.Eye11:
                        noseEdge = DeepNoseEdge;
                        break;
                    case EyeType.Eye12:
                        noseEdge = Eye12NoseEdge;
                        break;
                    default:
                }
            }
            if (species === Species.Pakled) {
                result += PakledBelowEyeProsthetic.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, skinColor);
            }

            return result + noseEdge;
        }
    }

    getSwatches(token: Token) {
        if (SpeciesRestrictions.isRubberHeaded(token.species)) {
            return [];
        } else if (token.species === Species.Tellarite) {
            return [
                new Swatch(EyeType.Eye1, "Vulcan-esque Angled Brows", (token) => EyeCatalog.decorateSwatch(EyeType.Eye1, token)),
                new Swatch(EyeType.Eye2, "Standard Brow", (token) => EyeCatalog.decorateSwatch(EyeType.Eye2, token)),
            ]
        } else {
            return [
                new Swatch(EyeType.Eye1, token.species === Species.Vulcan ? "Severe Brow" : "Vulcan-esque Angled Brows", (token) => EyeCatalog.decorateSwatch(EyeType.Eye1, token)),
                new Swatch(EyeType.Eye2, "Standard Brow", (token) => EyeCatalog.decorateSwatch(EyeType.Eye2, token)),
                new Swatch(EyeType.Eye3, "Thin Brow, Narrower Eyes", (token) => EyeCatalog.decorateSwatch(EyeType.Eye3, token)),
                new Swatch(EyeType.Eye4, "Thin Brow, Wider Eyes", (token) => EyeCatalog.decorateSwatch(EyeType.Eye4, token)),
                new Swatch(EyeType.Eye5, "Heavy Brow", (token) => EyeCatalog.decorateSwatch(EyeType.Eye5, token)),
                new Swatch(EyeType.Eye6, "Older", (token) => EyeCatalog.decorateSwatch(EyeType.Eye6, token)),
                new Swatch(EyeType.Eye7, "Feminine", (token) => EyeCatalog.decorateSwatch(EyeType.Eye7, token)),
                new Swatch(EyeType.Eye8, "Feminine, Thicker Lashes", (token) => EyeCatalog.decorateSwatch(EyeType.Eye8, token)),
                new Swatch(EyeType.Eye9, "Feminine, Round Brows", (token) => EyeCatalog.decorateSwatch(EyeType.Eye9, token)),
                new Swatch(EyeType.Eye10, "Feminine, Heavier Brows", (token) => EyeCatalog.decorateSwatch(EyeType.Eye10, token)),
                new Swatch(EyeType.Eye11, "Feminine, Cat-like", (token) => EyeCatalog.decorateSwatch(EyeType.Eye11, token)),
                new Swatch(EyeType.Eye12, "Narrow", (token) => EyeCatalog.decorateSwatch(EyeType.Eye12, token)),
            ];
        }
    }

    private static decorateSwatch(eyeType: EyeType, token: Token) {
        let result = `<svg viewBox="0 0 110 110" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <defs>
                    <clipPath id="eyeType` + eyeType + `">
                        <circle cx="55" cy="55" r="55" fill="#ffffff" />
                    </clipPath>
                </defs>
                <g clip-path="url(#eyeType` + eyeType + `">
                    <g transform="translate(-250, -75)">`
                    + EyeBrowCatalog.instance.getBrow(eyeType, token.species, "#f8f9fa", token.speciesOption)
                    + EyeCatalog.instance.getEyeAndNoseEdge(eyeType, token.species, "#ffffff").replace(/#754324/g, token.eyeColor)
                + `</g>
                </g>
            </svg>`;
        return result;
    }
}

export default EyeCatalog;